import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

import CreateRepositoryForm from './components/CreateRepositoryForm';
import AppRouter from './Router';



function App() {
  return (
    <div>
      <h1>Hypo Flow</h1>
      <CreateRepositoryForm />
    </div>
  );
}

ReactDOM.render(
  <React.StrictMode>
    <AppRouter />
  </React.StrictMode>,
  document.getElementById('root')
);

export default App;
